import React from 'react';
import { Link } from 'react-router-dom';
import './Infoshow.css';

function Infoshow () {
    return (
        <div>
            <BackgroundSection backgroundImage="url-to-your-background-image.jpg">
                <h1>Contenido sobre la Imagen de Fondo</h1>
            </BackgroundSection>
            <ImageButton 
                backgroundImage="url-to-your-button-image.jpg" 
                text="Click Me"
            />
        </div>
    );
}

export default Infoshow;
